      // select \u662f\u56e0\u4e3a\u5982\u679c\u524d\u9762\u90fd\u8df3\u8fc7\uff0c\u90a3\u4e48\u5f53\u524d\u80af\u5b9a\u662f\u4e2a\u975e\u6cd5\u72b6\u6001\n      if (!limit && select && dp[i][cnt] != -1) return dp[i][cnt];\n      int res = 0;\n      // \u4e4b\u524d\u6570\u4f4d\u90fd\u8df3\u8fc7\uff0c\u7ee7\u7eed\u8df3\u8fc7\u8be5\u6570\u4f4d\n      if (!select) {\n        res = dfs(i + 1, false, false, cnt);\n      }\n      // \u8ba1\u7b97\u5f53\u524d\u6570\u4f4d\u4e0a\u754c\n      int hi = limit ? nums[i] - '0' : 9;\n      // \u5982\u679c\u4e4b\u524d\u9009\u8fc7\u6570\uff0c\u5219\u5f53\u524d\u6570\u4f4d\u679a\u4e3e\u4ece0\u5f00\u59cb\uff0c\u5426\u5219\u4ece1\u5f00\u59cb\uff0c\u56e0\u4e3a\u9012\u5f52\u65f6select\u4e3atrue\n      // \u5982\u679c\u4e4b\u524d\u6ca1\u9009\u8fc7\u6570\uff0c\u8be5\u4f4d\u90090\u76f8\u5f53\u4e8e\u8df3\u8fc7\u8be5\u4f4d\n      for (int d = (1 - select); d <= hi; ++d) {\n        // \u6ce8\u610flimit\u5224\u65ad\n        res += dfs(i + 1, limit && d == hi, true, cnt + (d == 1));\n      }\n      if (!limit && select) dp[i][cnt] = res;\n      return res;\n    };\n\n    return dfs(0, true, false, 0);\n  }\n};\n")),(0,r.kt)("h2",{id:"\u540c\u65f6\u5b58\u5728\u4e0a\u4e0b\u754c"},"\u540c\u65f6\u5b58\u5728\u4e0a\u4e0b\u754c"),(0,r.kt)("admonition",{type:"info"},(0,r.kt)("mdxAdmonitionTitle",{parentName:"admonition"},"[",(0,r.kt)("a",{parentName:"mdxAdmonitionTitle",href:"https://leetcode.cn/problems/count-stepping-numbers-in-range/description/"},"2801. \u7edf\u8ba1\u8303\u56f4\u5185\u7684\u6b65\u8fdb\u6570\u5b57\u6570\u76ee"),"]"),(0,r.kt)("p",{parentName:"admonition"},"\u7ed9\u4f60\u4e24\u4e2a\u6b63\u6574\u6570 low \u548c high \uff0c\u90fd\u7528\u5b57\u7b26\u4e32\u8868\u793a\uff0c\u8bf7\u4f60\u7edf\u8ba1\u95ed\u533a\u95f4 ","[low, high]"," \u5185\u7684 \u6b65\u8fdb\u6570\u5b57 \u6570\u76ee ",(0,r.kt)("br",null),"\n\u5982\u679c\u4e00\u4e2a\u6574\u6570\u76f8\u90bb\u6570\u4f4d\u4e4b\u95f4\u5dee\u7684\u7edd\u5bf9\u503c\u90fd \u6070\u597d \u662f 1 \uff0